import React from 'react';
import CounterFn from './counterFn';

class Counter extends React.Component {
    render() {
        return(
            <div>Licznik {this.props.nazwa} {this.props.cos}
            <CounterFn nazwa={'Funkcyjny 1 Propsy'}/>
            </div>
        )
    }
};

export default Counter;
